import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardActions from "@material-ui/core/CardActions";
import CardMedia from "@material-ui/core/CardMedia";
import Button from "@material-ui/core/Button";
import Cards from './filter_card'
import {
  Grid,
  Card,
} from "@material-ui/core/";

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
});
const statData = [
  {
    title: "SAMPLE1",
    mission_ids: "1",
    launch_year: "2006",
    successful_launch: "false",
    successful_landing: "true",
    image: require("../images/image_1.jpg"),
  },
  {
    title: "SAMPLE2",
    mission_ids: "1",
    launch_year: "2006",
    successful_launch: "false",
    successful_landing: "true",
    image: require("../images/image_2.png"),
  },
  {
    title: "SAMPLE3",
    mission_ids: "1",
    launch_year: "2006",
    successful_launch: "false",
    successful_landing: "true",
    image: require("../images/image_3.png"),
  },
  {
    title: "SAMPLE4",
    mission_ids: "1",
    launch_year: "2006",
    successful_launch: "false",
    successful_landing: "true",
    image: require("../images/image_4.jpg"),
  },
  {
    title: "SAMPLE5",
    mission_ids: "1",
    launch_year: "2006",
    successful_launch: "false",
    successful_landing: "true",
    image: require("../images/image_5.png"),
  },
  {
    title: "SAMPLE6",
    mission_ids: "1",
    launch_year: "2006",
    successful_launch: "false",
    successful_landing: "true",
    image: require("../images/image_6.jpg"),
  },
];
export default () => {
  const classes = useStyles();
  // const settings = {
  //     slidesToShow: 3,
  //     cssEase: "linear",
  //   };
  return (
    <Box display="flex" p={1}>
    <Grid
      container
      spacing={2}
      direction="row"
      justify="flex-start"
      alignItems="flex-start"
    >
      {statData.map((cards, index) => (
        <Grid item xs={12} sm={6} md={3} key={statData.indexOf(cards)}>
          <Card className={classes.root}>
            <CardActionArea>
              <CardMedia
                component="img"
                alt="image"
                height="140"
                image={cards.image}
                title="Contemplative Reptile"
              />
              <CardMedia component='p'>{`# ${cards.title}`}</CardMedia>
              <CardMedia>{`Mission Ids : ${cards.mission_ids}`}</CardMedia>
              <CardMedia>{`Launch Year : ${cards.launch_year}`}</CardMedia>
              <CardMedia>{`Successful Launch :${cards.successful_launch}`}</CardMedia>
              <CardMedia>{`Successful Landing :${cards.successful_landing}`}</CardMedia>
              {/* <CardHeader avatar={`# ${cards.title}`} /> */}
             
            </CardActionArea>
          </Card>
        </Grid>
      ))}
    </Grid>
    </Box>
  );
};
